import React from 'react';
import { Link, Outlet } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
        <Link to='/'>Books</Link>
        <Link to='/categories'>Categories</Link>
        <Outlet/>
    </nav>
  )
}

export default Navbar
